    render() {
        const apiUrl = 'https://inshorts.me/news/topics/science';
        return (
            <div> className='main-main-container'
                <Title titleName = {'Science News'}/>
                <Newscard apiUrl={apiUrl} />
            </div>
        )
    }
}
